import React, { Component } from 'react'
import axios from 'axios'

export default class Blogs extends Component {

    constructor(props){
        super(props)
        this.state = {
            postsList:{}
        }
    }

    componentDidMount(){
      ///------- axios post get api -------////
      let url = "https://jsonplaceholder.typicode.com/posts";
      axios.get(url)
      .then(response=>{
          this.setState({
            postsList:response.data
